2380.source:
function onDrag(evt) {
    this.recordedPoints.push(evt.getPosition());
    var marker = lively.morphic.Morph.makeCircle(this.localize(evt.getPosition()), 5, 0, Color.red, Color.red);
    this.addMorph(marker);
}

