2392.source:
function onDragEnd(evt) {
    this.recognizeGesture();
    var pointMorphs = this.submorphs.without(this.get('learnButton')),
        pointMorphNodes = pointMorphs.collect(function(ea) {
            return ea.renderContext().morphNode });
    $(pointMorphNodes).animate({opacity: 0}, 1000, function() {
        pointMorphs.forEach(function(ea) { ea.remove() }) });
}

