2400.source:
function recognizeGesture(evt) {
    if (!this.recordedPoints) return null;
    var points = this.convertPointsForDollarRecognizer(this.recordedPoints);
    this.recognizedGesture = this.recognizer.Recognize(points, true);
    alertOK('Gesture: ' + this.recognizedGesture.Name);
    return this.recognizedGesture;
}

2404.source:
function loadDollarRecognizerLib() {
    var dollarJsUrl = "http://depts.washington.edu/aimgroup/proj/dollar/dollar.js",
        dollarJsSrc = new URL(dollarJsUrl).asWebResource().beSync().get().content,
        dollarJsInitFuncSrc = Strings.format(";(function loadDollarJs() {\n%s\nthis.DollarRecognizer = DollarRecognizer;\n}).call(Global);", dollarJsSrc);
    try {
        eval(dollarJsInitFuncSrc);
        this.recognizer = new Global.DollarRecognizer();
        if (this.storedGestures) {
            this.recognizer.Templates = this.storedGestures;
        }
        alertOK("dollar.js loaded");
    } catch(e) {
        alert("dollar.js failed to load");
    }
}

